#if !defined(__Linux64__)
bool Divide32(uint64 hi, uint64 lo, uint64 d, uint64 &_q, uint64 &_r)
{
    if (hi >= d)
        return false;                   // overflow (or divide by zero)

    uint64 q = 0;
    for (int i = 0; i < 64; ++i) {
        uint64 prev = hi;
        hi = (hi << 1) | (lo >> 63);
        lo <<= 1;
        q <<= 1;
        if (hi >= d || (prev >> 63)) {
            hi -= d;
            q |= 1;
        }
    }
    _q = q;
    _r = hi;
    return true;
}
#endif

